import React, { useState, useEffect } from 'react';
import './Home.css';
import axios from 'axios';

function Home() {
  const [farms, setFarms] = useState([]);

  useEffect(() => {
    const fetchFarms = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/farms');
        setFarms(response.data);
      } catch (error) {
        console.error('There was an error fetching the farm data!', error);
      }
    };

    fetchFarms();
  }, []);

  return (
    <div className="home-container">
      <h3>Farm Information</h3>
      <div className="farm-list">
        {farms.map((farm, index) => (
          <div key={index} className="farm-item">
            <h4>{farm.name}</h4>
            <p>Location: {farm.location}</p>
          </div>
        ))}
      </div>
      <div className="content-section">
        <h3>Actions Report</h3>
        <div className="actions-report">
          <p>Action 1: Feeding the chickens</p>
          <p>Action 2: Cleaning the coop</p>
          <p>Action 3: Collecting eggs</p>
          {/* Add more actions as needed */}
        </div>
      </div>
      <div className="content-section">
        <h3>Other Information</h3>
        {/* Add more sections as needed */}
      </div>
    </div>
  );
}

export default Home;
